import React from 'react';
import { Col, Container, Row } from 'reactstrap';
import '../styles/home.css';
import heroImg from '../assets/images/hero-img01.jpg'

const Home = () => {
  return (
    <>
      <section>
        <Container>
          <Row>
            <Col lg='6'>
              <div className="hero__content"></div>
            </Col>
          </Row>
        </Container>
      </section>
    </>
  );
};

export default Home;
